[[File:UCF Alumni Center.jpg|thumb|alt=A glass-clad and brick exterior of a modern-style, two-story building|275px|right|The FAIRWINDS Alumni Center at UCF]]
The [[University of Central Florida]] (UCF) is a [[Metropolitan area|metropolitan]] [[Public university|public]] research and [[space grant colleges|space-grant]] university located on a 1,415-acre (5.73&nbsp;km<sup>2</sup>) main campus in [[Orlando, Florida|Orlando]], Florida, United States.<ref name="facts">{{cite web |url=http://www.iroffice.ucf.edu/character/current.html |title=Facts About UCF |accessdate=2011-11-22 |publisher=UCF Office of Institutional Research}}</ref> UCF is a member institution of the [[State University System of Florida]] and is the [[List of largest United States universities by undergraduate enrollment|largest university]] in the United States in terms of undergraduate enrollment. It was founded in 1963 as Florida Technological University with the goal of providing highly trained personnel to support the [[Kennedy Space Center]]. When the university's academic scope expanded to encompass other disciplines, the school was renamed to the University of Central Florida in 1978. Initial enrollment in 1968 was 1,948 students; as of 2011, the university has 58,587 students from more than 140 countries, all 50 U.S. states and the [[District of Columbia]].<ref name="facts"/><ref>{{cite news |url=http://today.ucf.edu/ucf-moves-up-now-nations-3rd-largest/ |title=UCF Moves Up, Now Nationâs 3rd Largest |date= 2009-10-15 |accessdate=2010-07-21 |publisher=The University of Central Florida}}</ref> Since the university's first graduating class in 1970, UCF has awarded more than 200,000 degrees, including 35,000 graduate and professional degrees, to nearly 170,000 alumni.<ref name="facts" />

UCF alumni have made research contributions to optics, modeling and simulation, digital media, engineering and computer science, business administration, education and hospitality management. The university has produced eight members of the [[Florida House of Representatives]], a [[Florida Senate|Florida State Senator]], two [[National Aeronautics and Space Administration]] (NASA) astronauts, and numerous officers in the armed forces through a unique partnership with the [[United States armed forces]].<ref>{{cite news |url=http://www.centralfloridafuture.com/military-research-building-started-1.1773456 |title=Military research building started |date = 2007-07-12 |accessdate=2009-07-28 |work=Central Florida Future}}</ref><ref>{{cite news |url=http://www.centralfloridafuture.com/2.10679/rotc-gaining-in-popularity-1.1434425 |title=ROTC gaining in popularity |date = 2009-02-15 |accessdate=2009-10-05 |work=Central Florida Future}}</ref><ref>{{cite web |url=http://today.ucf.edu/student-veterans-embraced-by-military-friendly-ucf/ |title=Student Veterans Embraced by âMilitary Friendlyâ UCF |accessdate=2010-10-11 |date= 2010-09-10 |publisher=University of Central Florida}}</ref> UCF graduates have served at the head of organizations such as the [[Orlando Magic]], [[Walt Disney Parks and Resorts]], [[Texas Rangers (baseball)|Texas Rangers]], [[NASCAR]], [[Busch Entertainment Corporation]], [[Darden Restaurants]], [[Sun Sports]] and [[Fox Sports Florida]], and [[Raymond James Financial]]. Actress [[Cheryl Hines]], widely known for her role as [[Cheryl David]] on the [[HBO]] television series ''[[Curb Your Enthusiasm]]'', graduated from UCF with a degree in communication. ''[[The Blair Witch Project]]'', one of the most successful independent films produced,<ref>{{cite news |url=http://www.huffingtonpost.com/jessica-rovello/still-nauseous-after-all_b_247076.html |title=Still Nauseous After All these Years: Blair Witch Turns 10 |date = 2009-07-29 |accessdate=2009-07-31 |work=The Huffington Post}}</ref> was filmed by UCF students and directed by alumni [[Daniel Myrick]] and [[Eduardo Sanchez]].<ref>{{cite web |url=http://www.film.ucf.edu/links_webpages.php |title=Student & Alumni Sites |accessdate=2007-10-28 |publisher=University of Central Florida School of Film |archiveurl = http://web.archive.org/web/20070808191048/http://www.film.ucf.edu/links_webpages.php <!-- Bot retrieved archive --> |archivedate = 2007-08-08}}</ref>

As a competitor in college athletics, UCF has had many notable student athletes, coaches, and staff members, such as [[National Football League]] (NFL) players [[Daunte Culpepper]], [[Kevin Smith (running back)|Kevin Smith]] and [[Brandon Marshall]]; [[National Basketball Association]] (NBA) starting guard [[Jermaine Taylor (basketball)|Jermaine Taylor]]; [[NASCAR]] driver [[Aric Almirola]]; and champion woman's soccer player  [[Michelle Akers]]. As of 2010, more than 75 UCF alumni compete in professional sports, such as, [[basketball]], [[American football|football]], [[baseball]], [[golf]], [[soccer]] and [[auto racing]].

